function attackPaths(t,r){if(r=parseFloat(r),1==t)return[r];if(2==t){const t=Math.PI/180*15;return[r-t,r+t]}if(3==t){const t=Math.PI/180*15;return[r,r-t,r+t]}if(4==t){const t=Math.PI/180*15;return[r-t/2,r-1.5*t,r+t/2,r+1.5*t]}if(5==t){const t=Math.PI/180*15;return[r,r-t,r-2*t,r+t,r+2*t]}return[]}module.exports=attackPaths;